import AppContext from '../AppContext'
import { useContext } from 'react'
import { PieChart } from 'react-minimal-pie-chart';



function InsightsCharts() {
    const {categories} = useContext(AppContext)
    const arrofObjects = []
    useEffect(()=>{
      const test = Object.entries(categories)
      .map(([key, value])=>{
        const item = {}
        item.title = key;
        item.value = value
        item.color = '#E38627'
        arrofObjects.push(item)
        console.log('test',arrofObjects)
        return test
        })
    },[])



  return (
    <div><PieChart data={test}/></div>
  )
}

export default InsightsCharts
